        element
    })
    return(
        <section id='rules'>
            <h1>Rules</h1>
            <img src="/images/rules/image-rules-bonus.svg" alt='rules image'/>
            <button onClick={fechar}><img src='/images/rules/icon-close.svg' alt='close rules'/></button>
        </section>
    )
}export default RulesScreen
